async function fetchHitokoto(titleId: number, episodeId?: number) {
  const url = new URL("https://akiba-souken.com/anime/hitokoto/partial/?offset=0&type=item&id=388&supplement=51");
  url.searchParams.delete("supplement"); // 個別話数のヒトコトではなく、作品自体のヒトコトを取得
  if (episodeId != null) {
    url.searchParams.append("supplement", String(episodeId));
  }
  url.searchParams.delete("id");
  url.searchParams.append("id", String(titleId));
  url.searchParams.delete("offset");
  url.searchParams.append("offset", "0");
  const hitokotoList: Hitokoto[] = [];
  while (true) {
    const { htmlText, isCache, status, responseHeader, } = await fetchHttpGetText(db, url, { reqHeader: { "x-requested-with": "XMLHttpRequest" } });
    if (status != 200) {
      break;
    }
    const { hitokotoList: hl } = await parseAnimeTitleHitokotoPage(htmlText);
    hl.forEach(h => {
      hitokotoList.push(h);
    })
    if ("x-json" in responseHeader) {
      const jsonObj = JSON.parse(responseHeader["x-json"]);
      for (const [key, val] of Object.entries(jsonObj)) {
        if (key != "offset") {
          throw new Error(jsonObj);
        }
        url.searchParams.delete(key);
        url.searchParams.append(key, String(val));
      }
    } else {
      break;
    }
  }
  return hitokotoList;
}
