// エピソード一覧
for (const titleId of animeTitleIdList) {
  const index = animeTitleIdList.indexOf(titleId);
  console.log(`作品ごとのエピソード ${index + 1}/${animeTitleIdList.length}`);
  const hasReviewEpisodeId = new Set<number>();
  const allEpisodeId = new Set<number>();
  const titleAllEpisodeList: {
    episodeId: number;
    subTitle: string | null;
    reviewCount: number;
    score: number | null;
  }[] = [];
  {
    let nowRequestPage = 1;
    let totalPageCount = 1;
    while (true) {
      if (totalPageCount < nowRequestPage) {
        break;
      }
      const { htmlText } = await fetchHttpGetText(db, `https://akiba-souken.com/anime/${titleId}/list/?page=${nowRequestPage}`);
      nowRequestPage += 1;
      const { totalPageCount: tpc, episodeList } = await parseAnimeEpisodeListPage(htmlText);
      totalPageCount = tpc;
      episodeList.forEach(i => {
        titleAllEpisodeList.push(i);
      })
      for (const e of episodeList) {
        allEpisodeId.add(e.episodeId);
        if (e.reviewCount == 0 && e.score == null) {
          continue;
        }
        hasReviewEpisodeId.add(e.episodeId);
      }
    }
  }
  // https://akiba-souken.com/anime/388/list/
  avds.setEpisodeList(titleId, titleAllEpisodeList);
  for (const episodeId of hasReviewEpisodeId) {
    await fetchHttpGetText(db, `https://akiba-souken.com/anime/${titleId}/${episodeId}/`);
    const episodeHitokoto = await fetchHitokoto(titleId, episodeId);
    avds.setEpisodeHitokoto(titleId, episodeId, episodeHitokoto);
  }
}
